		<style>
			.piece { 
				  width: 240px;
				  height: 80px;
				  margin: 2px;
				  float: left;
				  background-color:lime;
			}
			.clear { clear:left }
			.container { width: 100% }
			
			/* buttons */
			section.press button 
			{
			  color: indigo;
			  background-color: #ddd;
			  border: 1px solid indigo;
			  border-radius: 15px;
			  box-shadow: 0 10px indigo;
			}
			section.press button:hover,
			section.press button.hover 
			{
			  background-color: #ddd
			  color: indigo;
			}
			section.press button:active,
			section.press button.active 
			{
			  background-color: #ddd;
			  box-shadow: 0 5px indigo;
			  color:indigo;
			  transform: translateY(5px);
			}
		</style>
		<title>Bot Detect</title>
	</head>

			<form method="get" action="CaptchaSet.rar">

			<form method="get" action="CaptchaSet.zip">

		</section>
